import React from 'react';
import styled from "styled-components";

export const LoginContainer = styled.div`
  display: flex;
  flex-direction: column;
  /* justify-content: center; */
  align-items: center;
  text-align: center;
  width: 360px;
  height: 90%;
  border-radius: 30px;
  background-color: #f9f9f9;
  box-shadow: 0px 0px 20px #d5d5d5;
  padding: 2px; 
  position: fixed;
  bottom: 0;
`;

export const LoginTitle = styled.div`
  margin-top: 60px;
  margin-bottom: 40px;
  color : #636363;
  font-family: Nanum Barun Gothic;
  font-size : 40px;
  font-weight: bold;
`;

export const LoginInputContainer = styled.div`
  width: 240px;
  height: 40px;
  border-radius: 20px;
  border: 2px solid #eeeeee;;
  /* box-shadow: 0px 0px 10px #e8e7e7; */
  background-color: #f9f9f9;
  padding: 2px; 
  margin: 5px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

export const LoginInput = styled.input`
  width: 80%;
  height: 60%;
  border: none;
  background-color: #f9f9f9;
  text-align: left;
  color : #808080;
  font-family: Nanum Barun Gothic;
  font-size : 15px;
  outline: none;
  ::placeholder {color: #cdcdcd}
  ::placeholder {font-size : 12px}
`;


export const LoginBtn = styled.div`
  width: 240px;
  height: 40px;
  border-radius: 20px;
  border: 2px solid #d0c3f9;;
  /* box-shadow: 0px 0px 10px #e8e7e7; */
  background-color: #d0c3f9;
  padding: 2px; 
  margin-top: 15px;
  display: flex;
  align-items: center;
  justify-content: center;
  color : #f9f9f9;
  font-family: Nanum Barun Gothic;
  font-size : 15px;
  font-weight: bold;
`;


const Login = () => {
  return (
    <LoginContainer>
      <LoginTitle>LOGIN</LoginTitle>
      <LoginInputContainer><LoginInput placeholder='아이디를 입력하세요'></LoginInput></LoginInputContainer>
      <LoginInputContainer><LoginInput placeholder='비밀번호를 입력하세요'></LoginInput></LoginInputContainer>
      <LoginBtn>로그인</LoginBtn>
      <LoginBtn>로그인</LoginBtn>
      <LoginBtn>로그인</LoginBtn>
    </LoginContainer>
  );
};

export default Login;
